import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import {Container} from "react-bootstrap";
import CountryBox from "./component/CountryBox";

// import {FloatingLabel} from "react-bootstrap";


function App() {
    return (
        <div className="App">
            <header className="App-header">
            </header>
            <main xs={3}>
                <CountryBox/>
            </main>
        </div>
    );
}

export default App;
